import { connect, useDispatch } from 'react-redux';
import { withRouter } from 'react-router-dom';

function Step1(props) {
  let dispatch = useDispatch();

  const sendInfo = (e) => {
    console.log('checking value of e: '.e.target.value);

    dispatch({
      type: 'UPDATE_CUSTOMER',
      payload: e
    });
  }

  return (
    <div className='quote'>

      <input placeholder='enter first name' onChange={(e) => sendInfo(e.target.value)} />
      <input placeholder='enter last name' />

      <p>How did you hear about us?</p>
      <select>
        <option>Via a friend</option>
        <option>Through an ad</option>
        <option>Online search</option>
        <option>Other</option>
      </select>

      <button onClick={() => props.history.push('/quote')}>go back</button>
      <button onClick={() => props.history.push('/step2')}>go to step 2</button>
    </div>
  );
}

export default connect()(withRouter(Step1));
